import { createClient } from 'redis';

class RedisClient {
  constructor() {
    // Cration du client Redis
    this.client = createClient();
    this.client.on('error', (err) => {
      console.error(`Redis Client Error: ${err}`);
    });
  }

  // Vrifie si la connexion Redis est active
  isAlive() {
    return this.client.connected;
  }

  // Rcupre la valeur associe  une cl Redis
  async get(key) {
    return new Promise((resolve, reject) => {
      this.client.get(key, (err, value) => {
        if (err) {
          reject(err);
        } else {
          resolve(value);
        }
      });
    });
  }

  // Dfinit une valeur avec une dure d'expiration
  async set(key, value, duration) {
    return new Promise((resolve, reject) => {
      this.client.setex(key, duration, value, (err) => {
        if (err) {
          reject(err);
        } else {
          resolve();
        }
      });
    });
  }

  // Supprime une cl Redis
  async del(key) {
    return new Promise((resolve, reject) => {
      this.client.del(key, (err) => {
        if (err) {
          reject(err);
        } else {
          resolve();
        }
      });
    });
  }
}

// Exporter une instance de RedisClient
const redisClient = new RedisClient();
export default redisClient;

