import { MongoClient } from 'mongodb';

// Variables d'environnement pour configurer la connexion
const DB_HOST = process.env.DB_HOST || 'localhost';
const DB_PORT = process.env.DB_PORT || 27017;
const DB_DATABASE = process.env.DB_DATABASE || 'files_manager';

class DBClient {
  constructor() {
    const url = `mongodb://${DB_HOST}:${DB_PORT}`;
    this.client = new MongoClient(url, { useNewUrlParser: true, useUnifiedTopology: true });
    this.db = null;
  }

  async connect() {
    try {
      await this.client.connect();
      this.db = this.client.db(DB_DATABASE);
      console.log(`Connected to MongoDB at ${DB_HOST}:${DB_PORT} and database ${DB_DATABASE}`);
    } catch (error) {
      console.error('Failed to connect to MongoDB:', error);
    }
  }

  // Mthode pour vrifier si la connexion est active
  async isAlive() {
    try {
      const result = await this.db.command({ ping: 1 });
      return result.ok === 1;
    } catch (error) {
      console.error('MongoDB connection is not alive:', error);
      return false;
    }
  }

  // Mthode pour obtenir le nombre d'utilisateurs
  async nbUsers() {
    try {
      const usersCollection = this.db.collection('users');
      const count = await usersCollection.countDocuments();
      return count;
    } catch (error) {
      console.error('Failed to get the number of users:', error);
      return 0;
    }
  }

  // Mthode pour obtenir le nombre de fichiers
  async nbFiles() {
    try {
      const filesCollection = this.db.collection('files');
      const count = await filesCollection.countDocuments();
      return count;
    } catch (error) {
      console.error('Failed to get the number of files:', error);
      return 0;
    }
  }

  // Mthode pour fermer la connexion
  async close() {
    await this.client.close();
  }
}

// Cration et exportation de l'instance de DBClient
const dbClient = new DBClient();
export { dbClient };

